import React, { useState } from 'react'
import { Button, Form, FormGroup, Label, Input } from 'reactstrap'

import api from '../../services/api'

const REgister = ({history}) => {
    const [email, setEmail] = useState('')
    const [password, setPassword] = useState('')
    const [firstName, setFirstName] = useState('')
    const [lastName, setLastName] = useState('')

    const handleSubmit = async event => {
        event.preventDefault()
        console.log('result of the submit', email, password)

        const response = await api.post('/login', {email, password, firstName, lastName})
        const userId = response.data._id || false

        if(userId) {
            localStorage.setItem('user', userId)
            history.push('/dashboard')
        } else {
            const { message } = response.data
            console.log(message)
        }
    }

    return (
        <Form onSubmit={handleSubmit}>
            <FormGroup>
                <Input type="text" name="firstname" id="firstName" placeholder="Enter your first name" onChange={event => setFirstName(event.target.value)} />
            </FormGroup>
            <FormGroup>
                <Input type="text" name="lastname" id="lastName" placeholder="Enter your last name" onChange={event => setLastName(event.target.value)} />
            </FormGroup>
            <FormGroup>
                <Input type="email" name="email" id="exampleEmail" placeholder="Enter your email" onChange={event => setEmail(event.target.value)} />
            </FormGroup>
            <FormGroup>
                <Input type="password" name="password" id="examplePassword" placeholder="Enter a password" onChange={event => setPassword(event.target.value)} />
            </FormGroup>
            <Button>Submit</Button>
        </Form>
    )
}

export default REgister
